function getHashVariable(name) {
	var s=window.location.hash.substring(1);
	var stuff=s.split("&");
	for (i=0;i<stuff.length;i++) {
		var split=stuff[i].split("=");
		if(split[0]==name) {
			return split[1];
		}
	}
	return null;
}
